 Tugas 5 PBO adalah membuat program sederhana menggunakan konsep OOP (Object Oriented Programming). Program tersebut dapat berupa aplikasi berbasis GUI (Graphical User Interface) ataupun aplikasi berbasis CLI (Command Line Interface).

Contoh program sederhana menggunakan OOP adalah sebagai berikut:

// Program sederhana menggunakan OOP

// Deklarasi class
public class ProgramSederhana {

    // Deklarasi atribut
    private String nama;
    private int umur;

    // Konstruktor
    public ProgramSederhana(String nama, int umur) {
        this.nama = nama;
        this.umur = umur;
    }

    // Method
    public void info() {
        System.out.println(""Nama saya adalah "" + this.nama + "" dan umur saya adalah "" + this.umur + "" tahun."");
    }
}

// Main class
public class Main {

    public static void main(String[] args) {
        ProgramSederhana program = new ProgramSederhana(""John Doe"", 20);
        program.info();
    }
}

