int main(){

    int n,m;
    cin>>n>>m;
    int arr[n][m];
    for(int i=0;i<n;i++){
        for(int j=0;j<m;j++){
            cin>>arr[i][j];
        }
    }
    int max_sum=0;
    int sum=0;
    for(int i=0;i<n;i++){
        for(int j=0;j<m;j++){
            for(int k=i;k<n;k++){
                for(int l=j;l<m;l++){
                    sum=0;
                    for(int a=i;a<=k;a++){
                        for(int b=j;b<=l;b++){
                            sum+=arr[a][b];
                        }
                    }
                    if(sum>max_sum)
                        max_sum=sum;
                }
            }
        }
    }
    cout<<max_sum<<endl;
    return 0;
}

